.chart-container {
    width: 100%;
    margin-top: 1rem;
    background: #fff;
    border: 1px solid #ddd;
    border-radius: 6px;
    padding: 1rem;
    box-shadow: 0 2px 6px rgba(0, 0, 0, 0.07);
    animation: fadeInChart 0.5s ease forwards;
  }
  
  /* Subtle fade in for the chart container */
  @keyframes fadeInChart {
    from {
      opacity: 0;
    }
    to {
      opacity: 1;
    }
  }
  
  .bar-chart {
